import React from "react";
import Transport from "./components/Transport";
import InstrumentsContainer from "./components/InstrumentsContainer";

class App extends React.Component {
  state = {};
  render() {
    return (
      <div>
        <InstrumentsContainer />
        <Transport />
      </div>
    );
  }
}

export default App;
